 Complete el medio de transporte y la ruta y especifique la fecha de salida, el número del vehículo de transporte y el puerto de carga y descarga, en la medida en que se conozca. Si no se conoce, agregue "***" (tres estrellas). Casilla 4: Se puede incluir el Número de Pedido del Cliente, el Número de Carta de Crédito, entre otros. Si el Certificado de Origen no ha sido emitido antes o en el momento del envío, el organismo autorizado debe marcar "EMITIDO RETROSPECTIVAMENTE" aquí. En el caso de que una mercancía sea facturada por un operador que no sea Parte, en esta casilla se indicará el nombre legal completo del operador que no sea Parte y del productor de las mercancías. Casilla 5: Indique el número de artículo. Casilla 6: Indique las marcas y números de envío que figuren en los bultos, cuando existan tales marcas y números. Se especificará el número y el tipo de bultos. Proporcione una descripción completa de cada mercancía. La descripción debe ser lo suficientemente detallada para permitir que las mercancías sean identificadas por los Funcionarios de Aduanas que los examinen y se relacionará con la descripción de la factura y con la descripción del SA de la mercancía. Si las mercancías no están embaladas, indíquese "al granel". Cuando la descripción de los productos esté terminada, agregue "***" (tres estrellas) o " \ " (barra diagonal final). Casilla 7: Para cada mercancía descrita en la Casilla 6, identifique la clasificación arancelaria del SA en un código de seis dígitos. Casilla 8: Para cada mercancía descrita en la Casilla 6, indique qué criterio es aplicable, de conformidad con las siguientes instrucciones. Las reglas de origen figuran en el Capítulo 4 (Reglas de Origen y Procedimientos de Aplicación) y en el Anexo 4 (Requisitos Específicos de Origen por Producto). Criterio de Origen Insértese en la Casilla 8 La mercancía es "íntegramente obtenida" en el territorio de una Parte, como se establece en el Artículo 4.3 (Mercancías Íntegramente Obtenidas) o según se requiriera en el Anexo 4 (Requisitos Específicos de Origen por Producto). IO La mercancía se produce íntegramente en el territorio de una Parte, exclusivamente a partir de materiales cuyo origen se ajusta a las disposiciones del Capítulo 4 (Reglas de Origen y Procedimientos de Aplicación). IP Regla General del ≥: 40% de valor de contenido regional. VCR La mercancía se produce en el territorio de una Parte, utilizando materiales no originarios que cumplen con el Anexo 4 (Requisitos Específicos de Origen por Producto) y otras disposiciones aplicables del Capítulo 4 (Reglas de Origen y Procedimientos de Aplicación). REO Casilla 9: Indique la cantidad con unidades de medida para cada mercancía descrita en la Casilla 6. Pueden usarse otras unidades de medida, por ejemplo, volumen o número de artículos, que indicarían cantidades exactas, cuando sea habitual. Casilla 10: El número y la fecha de la factura (incluida la factura emitida por un operador que no sea Parte) deben indicarse aquí. Casilla 11:La casilla deberá ser completada por el productor o exportador. Inserte la fecha, lugar y la firma de la persona autorizada. Casilla 12: La casilla deberá ser completada, fechada, firmada o sellada por la persona autorizada del organismo autorizado. Anexo 6 Reglas de Procedimiento del Tribunal Arbitral Primeras Comunicaciones Escritas 1. Se propone a la Parte reclamante que entregue su primera comunicación escrita a más tardar 20 días después del nombramiento del último árbitro. Se propone a la Parte reclamada que entregue su primera comunicación escrita a más tardar 30 días después de la fecha de entrega de la primera comunicación escrita de la Parte reclamante, a menos que el tribunal arbitral decida de lo contrario. 2. Una Parte proporcionará una copia de su primera comunicación escrita a cada uno de los árbitros y a la otra Parte. También se facilitará una copia de los documentos en formato electrónico. Audiencias 3. El presidente del tribunal arbitral fijará la fecha y hora de la audiencia después de consultar con las Partes y otros miembros del tribunal. El lugar de las audiencias será acordado por las Partes de conformidad con el Artículo 13.9 (Reglas de Procedimiento del Tribunal Arbitral). Si no hay acuerdo, el lugar se alternará entre los territorios de las Partes, siendo la primera audiencia celebrada en el territorio de la Parte que responde al procedimiento. El presidente del tribunal arbitral notificará por escrito a las Partes la fecha, hora y lugar de la audiencia. A menos que cualquiera de las Partes no esté de acuerdo, el panel podrá decidir no convocar una audiencia. 4. El panel podrá convocar audiencias adicionales. 5. Todos los árbitros estarán presentes en las audiencias. 6. Las audiencias del tribunal arbitral se celebrarán a puerta cerrada. Observaciones Escritas Complementarias 7. Dentro de los 20 días siguientes a la fecha de la audiencia, cada Parte podrá presentar una comunicación escrita complementaria en respuesta a cualquier asunto que haya surgido durante la audiencia. Las observaciones escritas complementarias se presentarán de conformidad con el párrafo 2 de estas Reglas. Preguntas por Escrito 8. El tribunal arbitral podrá, en cualquier momento durante el procedimiento, formular preguntas por escrito a las Partes. 9. Una Parte entregará la respuesta escrita al tribunal arbitral y a la otra Parte de conformidad con el calendario establecido por el tribunal arbitral. Cada Parte tendrá la oportunidad de presentar observaciones por escrito sobre la respuesta de la otra Parte. Confidencialidad 10. Las audiencias del tribunal arbitral y los documentos que se le presenten se mantendrán confidenciales. Nada de lo dispuesto en el Capítulo 13 (Solución de Diferencias) impedirá que una Parte divulgue al público declaraciones de sus propias posiciones. La información presentada por una Parte al tribunal arbitral que esa Parte haya designado como confidencial será tratada como confidencial. Contactos Ex parte 11. El tribunal arbitral no se reunirá ni contactará a una Parte en ausencia de la otra Parte. 12. Ninguna Parte podrá ponerse en contacto con ningún árbitro en relación con la disputa en ausencia de la otra Parte u otros árbitros. 13. Ningún panelista podrá discutir ningún aspecto del objeto del procedimiento con una Parte o ambas Partes en ausencia de otros árbitros. Función de los Expertos 14. A solicitud de una Parte, o por iniciativa propia, el tribunal arbitral podrá solicitar información y asesoramiento técnico de cualquier persona u organismo que considere apropiado. Cualquier información así obtenida será facilitada a las Partes para que formulen observaciones. 15. Cuando el tribunal tome en consideración dicha información o asesoramiento técnico en la preparación de su informe, también tendrá en cuenta cualquier comentario u observación presentada por las Partes sobre la información o el asesoramiento técnico. Idioma de Trabajo 16. A menos que las Partes acuerden otra cosa, el idioma de trabajo del procedimiento de solución de diferencias será el inglés. Siempre que un documento se presente en chino o castellano, la Parte que presente el documento deberá presentar una traducción al inglés.',
