a y hora de la audiencia después de consultar con las Partes y otros miembros del tribunal. El lugar de las audiencias será acordado por las Partes de conformidad con el Artículo 13.9 (Reglas de Procedimiento del Tribunal Arbitral). Si no hay acuerdo, el lugar se alternará entre los territorios de las Partes, siendo la primera audiencia celebrada en el territorio de la Parte que responde al procedimiento. El presidente del tribunal arbitral notificará por escrito a las Partes la fecha, hora y lugar de la audiencia. A menos que cualquiera de las Partes no esté de acuerdo, el panel podrá decidir no convocar una audiencia. 4. El panel podrá convocar audiencias adicionales. 5. Todos los árbitros estarán presentes en las audiencias. 6. Las audiencias del tribunal arbitral se celebrarán a puerta cerrada. Observaciones Escritas Complementarias 7. Dentro de los 20 días siguientes a la fecha de la audiencia, cada Parte podrá presentar una comunicación escrita complementaria en respuesta a cualquier asunto que haya surgido durante la audiencia. Las observaciones escritas complementarias se presentarán de conformidad con el párrafo 2 de estas Reglas. Preguntas por Escrito 8. El tribunal arbitral podrá, en cualquier momento durante el procedimiento, formular preguntas por escrito a las Partes. 9. Una Parte entregará la respuesta escrita al tribunal arbitral y a la otra Parte de conformidad con el calendario establecido por el tribunal arbitral. Cada Parte tendrá la oportunidad de presentar observaciones por escrito sobre la respuesta de la otra Parte. Confidencialidad 10. Las audiencias del tribunal arbitral y los documentos que se le presenten se mantendrán confidenciales. Nada de lo dispuesto en el Capítulo 13 (Solución de Diferencias) impedirá que una Parte divulgue al público declaraciones de sus propias posiciones. La información presentada por una Parte al tribunal arbitral que esa Parte haya designado como confidencial será tratada como confidencial. Contactos Ex parte 11. El tribunal arbitral no se reunirá ni contactará a una Parte en ausencia de la otra Parte. 12. Ninguna Parte podrá ponerse en contacto con ningún árbitro en relación con la disputa en ausencia de la otra Parte u otros árbitros. 13. Ningún panelista podrá discutir ningún aspecto del objeto del procedimiento con una Parte o ambas Partes en ausencia de otros árbitros. Función de los Expertos 14. A solicitud de una Parte, o por iniciativa propia, el tribunal arbitral podrá solicitar información y asesoramiento técnico de cualquier persona u organismo que considere apropiado. Cualquier información así obtenida será facilitada a las Partes para que formulen observaciones. 15. Cuando el tribunal tome en consideración dicha información o asesoramiento técnico en la preparación de su informe, también tendrá en cuenta cualquier comentario u observación presentada por las Partes sobre la información o el asesoramiento técnico. Idioma de Trabajo 16. A menos que las Partes acuerden otra cosa, el idioma de trabajo del procedimiento de solución de diferencias será el inglés. Siempre que un documento se presente en chino o castellano, la Parte que presente el documento deberá presentar una traducción al inglés.',
